INSERT INTO `metas` VALUES (1,'wsar_score','Project Development','Every project has development risk associated with jurisdiction, physical location, complexity, and non-stakeholder acceptance. A careful assessment of potential issues facing commercial PV projects, such as the age of a roof, shade concerns, interconnection challenges, permitting hurdles, and community aesthetics, is incorporated into the WSAR score.','2016-10-10 11:42:02','2016-10-10 11:42:02'),(2,'wsar_score','Standardized Documents','Full credit given when Wiser Capital standard PPA, Site Lease and Option Agreement are used in a transaction.','2016-10-10 11:42:02','2016-10-10 11:42:02'),(3,'wsar_score','Project Permitting','Full credit given when permits are in hand with no risk of delay or denial. Partial credit is given if permits in process but not yet approved or permits risks and costs are minimal and known. No credit given if permitting issues are unknown or uncertain.','2016-10-10 11:42:02','2016-10-10 11:42:02'),(4,'wsar_score','Utility Interconnection Process','Full credit is given when interconnection studies completed or waived by local utility or interconnection agreements are available without any additional study or fees. No credit is given when interconnection requirements and costs are unknown.','2016-10-10 11:42:02','2016-10-10 11:42:02'),(5,'wsar_score','Installer Work Experience, Financial Standing & Insurance','A Solar Integrator or Engineering, Procurement and Construction Company must meet all work experience, financial standing and insurance requirements including but not limited to: uploaded financial documents, significant solar project experience of similar size and scope as the project being proposed, certificate of good standing, appropriate insurance including workers compensation and at least $1 million in general liability, proven financial strength or ability to deliver a payment and performance bond if required.','2016-10-10 11:42:02','2016-10-10 11:42:02'),(6,'wsar_score','Certified Roofing Study','Full credit if the life of the roof is greater than the PPA term. No credit if it is less.','2016-10-10 11:42:02','2016-10-10 11:42:02'),(7,'wsar_score','Structural Engineering','Full credit for having completed the structural engineering. Credit waived if structural engineering is not required.','2016-10-10 11:42:02','2016-10-10 11:42:02'),(8,'wsar_score','Soil Conditions & Potential Risks','Full credit when a hydrology report and and Environmental Report are not required or acceptable reports have been provided. Partial credit if one of the studies are required. If \'unknown\', no points will be awarded.','2016-10-10 11:42:02','2016-10-10 11:42:02'),(9,'wsar_score','Interest in Property','Full credit given when the property is owner occupied or the lease term is longer than the PPA term.','2016-10-10 11:42:02','2016-10-10 11:42:02'),(10,'wsar_score','System Performance','At the heart of a project is the hardware that sits in the unrelenting sun to generate clean electricity. The WSAR score accesses the technical specification and manufacturer longevity of the hardware used in commercial projects.','2016-10-10 11:42:02','2016-10-10 11:42:02'),(11,'wsar_score','Panel Manufacturer Warranty','Full credit given for panels with linear warranties guaranteeing 85% of nameplate capacity for 30 years with sufficient US based financial status to stand behind the warranty.  Partial credit for shorter guarantees, staged warranties, or lower nameplate guarantees. Panels with warranties guaranteeing less than 80% of faceplate at year 20 or with inadequate financial backing will not be accepted.','2016-10-10 11:42:02','2016-10-10 11:42:02'),(12,'wsar_score','Project Specific Performance Insurance - Optional','Panel wafer manufacturer and module materials must both have a proven process greater than 5 years.','2016-10-10 11:42:02','2016-10-10 11:42:02'),(13,'wsar_score','Panel Manufacturer Performance History and Process','Acceptable historic performance of modules has been approved.','2016-10-10 11:42:02','2016-10-10 11:42:02'),(14,'wsar_score','Inverter Manufacturer Financial Strength','Full credit for manufacturers with sufficient U.S. based financial strength to stand behind warranty or provides pooled performance insurance.','2016-10-10 11:42:02','2016-10-10 11:42:02'),(15,'wsar_score','Inverter Warranty','Full credit for extended warranty. Partial credit for industry standard warranty of 10-15 years.','2016-10-10 11:42:02','2016-10-10 11:42:02'),(16,'wsar_score','Rack System & Monitoring Service','Full credit for Racking systems and Monitoring Services that have Satisfactory Performance History.','2016-10-10 11:42:02','2016-10-10 11:42:02'),(17,'wsar_score','Host Facility Creditworthiness','A careful analysis of a facility’s creditworthiness is given significant weight in determining the WSAR score. Financial statement, D&B, and BBB records are evaluated to determine the capacity and likelihood that a host facility can and will honor its commitments for the full term of the agreement.','2016-10-10 11:42:02','2016-10-10 11:42:02'),(18,'wsar_score','Business Financial Strength','Full points are given automatically to host facilities that meet the minimum public credit rating criteria. Alternatively, host shall provide audited financial reports for a minimum of two years. Wiser then undertakes a bank-like underwriting assessment gaged by liquidity, consistency of revenues, debt-to-equity ratio, current assets/current liabilities ratio, fixed-charge coverage ratio, historic performance of accounts receivable and historic profit margins.','2016-10-10 11:42:02','2016-10-10 11:42:02'),(19,'wsar_score','History & Long Term Viability','In this subsection WSAR reviews the nature of the Host’s business activity, the concentration or dependency on a limited number of clients, the long term prospects for the Host’s specific industry focus, the Host’s revenue, expenses and market share in comparison to industry norms. Additionally, this subsection will review the Host’s capacity to make a long term commitment to the occupancy of the premises and the likelihood of consistent long term power consumption patterns.','2016-10-10 11:42:02','2016-10-10 11:42:02'),(20,'wsar_score','Host Facility Savings','Points are awarded if there is strong evidence that the Host will, commencing with the first year, consistently experience a lower cost of energy as a result of the solar installation and that these cost savings are likely to increase overtime to provide a strong deterrent to a Host’s potential for payment default.','2016-10-10 11:42:02','2016-10-10 11:42:02'),(21,'wsar_score','Legal and Policy','As instruments in the heavily regulated financial and energy space, PPAs can face legal and policy challenges that change depending on the state, county, local, utility, and community regulations and standards that govern them. The WSAR score rates all potential legal and policy exposures facing a given project.','2016-10-10 11:42:02','2016-10-10 11:42:02'),(22,'wsar_score','Project Fire & Casualty Risk','Full credit given when all the Wiser Capital insurance requirements for property and casualty, and environmental risk have been met.','2016-10-10 11:42:02','2016-10-10 11:42:02'),(23,'wsar_score','Host Fire & Casualty Insurance','Full credit given if Host maintains fire and casualty insurance with replacement cost & zoning code endorsements.','2016-10-10 11:42:02','2016-10-10 11:42:02'),(24,'wsar_score','Subordination and Non Disturbance Agreement','A subordination and non disturbance agreement (SNDA) addresses the priority of the rights of tenants and lenders. It deals with how and when the rights of tenants will be subordinate to the rights of lenders or, sometimes at lender’s option, senior to the rights of lenders. The non-disturbance portion assures tenants that their rights to their premises will be preserved (“nondisturbed”) on specified conditions within their control, even if the landlord defaults on its loan and the lender forecloses.','2016-10-10 11:42:02','2016-10-10 11:42:02'),(25,'wsar_score','Title Insurance, Lien Rights, Roof Penetration Insurance','Full credit given if title insurance or other approved documentation is in place providing certainty regarding the priority rights of the solar equipment owners and a 10 year or better warranty has been provided for leakage issues related to roof penetrations. Partial credit may be given for one of these items.','2016-10-10 11:42:02','2016-10-10 11:42:02'),(26,'wsar_score','Public Policy & Rate Risks','Full credit given when there are no potential policy or rate changes from state or local regulators or utility that could change or threaten PPA cash flow economics.','2016-10-10 11:42:02','2016-10-10 11:42:02'),(27,'wsar_score','Servicing and Administration','PV systems and the PPAs that drive them are long-term assets. Therefore, the systems require reliable and efficient servicing and proficient, ongoing administration of PPA accounting, billing, and receipts. These components, which investors often overlook, are reflected in the WSAR score.','2016-10-10 11:42:02','2016-10-10 11:42:02'),(28,'wsar_score','O&M','Full credit for experienced solar contractor or service provider with experience performing maintence and servicing solar systems.  Wiser Capital manages this contract','2016-10-10 11:42:02','2016-10-10 11:42:02'),(29,'wsar_score','Servicing Risk','Full credit for experienced servicer, cash manager, accounting report and contract management company. Wiser Capital manages these contracts.','2016-10-10 11:42:02','2016-10-10 11:42:02'),(30,'wsar_score','Sequestered Account','Full credit when sequestered account is established for payment processing and administration of payments to investors.','2016-10-10 11:42:02','2016-10-10 11:42:02'),(31,'wsar_score','Business Interruption Insurance','Full credit when business interruption insurance has been secured on behalf of the project investors.','2016-10-10 11:42:02','2016-10-10 11:42:02'),(32,'wsar_score','First Loss Surety','To provide confidence in this emerging asset class, which has limited historical performance data, less risk-averse participants hold “first loss” positions to help ensure other participants achieve their anticipated returns. for additional exposure, they may gain higher returns or benefits. the wsar score incorporates percentage of a total project’s “first loss” funding.','2016-10-10 11:42:02','2016-10-10 11:42:02'),(33,'wsar_score','5% First Loss Surety','Helper','2016-10-10 11:42:02','2016-10-10 11:42:02');
/*!40000 ALTER TABLE `metas` ENABLE KEYS */;
UNLOCK TABLES;

